'ᥱδᥲᴛь ᴛы υ᧐ᤋᥲ ᥱδᥲннᥲя, ᴛы дᥲʙᥲᥔ нᥱ δᥲдᥲᥔ ⲙᥱня, ᴛы ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ ᴛʙ᧐ᥔ ᧐ᴛᥱц ᤋ᧐᧐ɸᥙ᧘ ᧐н нᥱ ᥰ᧐ᥴⲙ᧐ᴛρᥙᴛ чᴛ᧐ ᴛы υ᧐ᤋᥲ, ʙ᧐ᤋьⲙᥱᴛ ᥙ ʙыᥱδᥱᴛ ᴛᥱδя',
