    @loader.loop(interval=10800, autostart=True, wait_before=False)
    async def check_for_updates(self) -> None:
        """𐌿ⲣ꤀𐌱ꤕⲣӄⲁ ꤀δн꤀𐌱᠕ꤕнυύ ⲙ꤀ⲇყ᠕я"""
        module_name = "JujutsuKaisen"
        module = self.lookup(module_name)
        sys_module = inspect.getmodule(module)
        local_file = io.BytesIO(sys_module.__loader__.data)
        local_file.name = f"{module_name}.py"
        local_file.seek(0)
        local_first_line = local_file.readline().strip().decode("utf-8")

        correct_version = sys_module.__version__
        correct_version_str = ".".join(map(str, correct_version))

        logger.info("\n🔍 𐌿ⲣ꤀𐌱ꤕⲣяю нⲁ᠕υчυꤕ ꤀δн꤀𐌱᠕ꤕнυύ")
        async with aiohttp.ClientSession() as session:
            async with session.get(UPDATE_URL) as response:
                if response.status == 200:
                    remote_content = await response.text()
                    remote_lines = remote_content.splitlines()
                    new_version = remote_lines[0].split("=", 1)[1].strip().strip("()").replace(",", "").replace(" ", ".")
                else:
                    logger.error(f"\n❌ ᱛⲱυⳝӄⲁ ꤀δн꤀𐌱᠕ꤕнυя")
                    return
        if new_version > correct_version_str:
            update_message = self.strings["update_available"].format(new_version=new_version, prefix=self.get_prefix(), UPDATE_URL=UPDATE_URL)
            logger.info(
                f"📢 Ⲇ꤀сⲧყᥰнⲁ н꤀𐌱ⲁя 𐌱ꤕⲣсυя: {new_version}\n"
                f"🔮 ꤀δн꤀𐌱υⲧься: {self.get_prefix()}dlmod {UPDATE_URL}"
            )
            keyboard = InlineKeyboardMarkup(inline_keyboard=[[
                InlineKeyboardButton(text='👑 𑀥ᥱ᥎ᥱᥣ᧐ρᥱr', url='https://t.me/Kowalskiu')],[
                InlineKeyboardButton(text='💙 Aᥒ᧐ᥒ 𐌑ᥱ᥉᥉ᥲgᥱ', url='http://t.me/anonaskbot?start=mzyay')]
                ]
            )
            await self.inline.bot.send_photo(self.tg_id, "https://envs.sh/MJG.jpg", caption=update_message, reply_markup=keyboard)
            await self.client.send_file("me", "https://envs.sh/MJG.jpg", caption=update_message)
            await self.allmodules.commands["dlmod"](await self.client.send_message(self.tg_id, f"{self.get_prefix()}dlmod {UPDATE_URL}"))

