    async def khelpcmd(self, message):
        """➤ ⭐𐌿꤀ӄⲁⳅы𐌱ⲁꤕⲧ ӄ꤀᠕υчꤕⲥⲧ𐌱꤀ ⲙ꤀ⲇყ᠕ꤕύ💜"""


        mload = await utils.answer(message, self.strings("load"))
        await mload.delete()
        prefix = f"{self.strings('cmd').format(str(self.get_prefix()))}\n"
        result = f"{self.strings('amount').format(str(len(self.allmodules.modules)))}\n"

        for mod in self.allmodules.modules:
            try:
                name = mod.strings["name"]
            except KeyError:
                name = mod.__clas__.__name__
            emoji = self.strings("module") if mod.__origin__.startswith("<core") else self.strings("core_module")
            result += f"\n {emoji} <code>{name}</code>"

        result += "" if self.lookup("Loader").fully_loaded else f"\n\n{self.strings('partial_load')}"
        result += f"\n\n {prefix}"
        chat_id = message.chat_id
        if chat_id:
             await self.client.send_file(message.peer_id, media_files8, caption=result)

