' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Я ᴛʙ᧐ю ⲙᥲᴛь υ᧐ᴦдᥲ ᥱδᥲ᧘ ʙ ᥰ᧐ᥴ᧘ᥱднᥙᥔ ρᥲᤋ ᴛ᧐ ᧐нᥲ υρᥙчᥲ᧘ᥲ υᥲυ ᥱδᥲнᥲя ɯ᧘ю᥊ᥲ ᥙ ᤋʙᥲ᧘ᥲ нᥲ ᥰ᧐ⲙ᧐щь н᧐ я ᥴρᥲᤋу жᥱ удᥲρᥙ᧘ ᥱᥔ ʙ ᥱδᥲ᧘᧐ ᥙ ᧐нᥲ уᥴᥰ᧐υ᧐ᥙ᧘ᥲᥴь<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ ᴛы ᥰρ᧐ᥴᴛ᧐ ᥱδᥲнᥲя υучᥲ ᴦ᧐ʙнᥲ ᥲ ᴛʙ᧐я ⲙᥲᴛь ᥱδᥲнᥲя ɯ᧘ю᥊ᥲ? Тʙ᧐я ᥴᥱⲙья нᥲ᥊уᥔ ᥴ᧐ᥴᴛ᧐ᥙᴛ ᥙᤋ ᥴᥰ᧘᧐ɯны᥊ уᥱδυ᧐ʙ ᥙ ᴛы ᥴᥲⲙыᥔ ᴦ᧘ᥲʙныᥔ ᥰᥙд᧐ρᥲᥴ ʙ ᥴʙ᧐ᥱᥔ ᥰᥙд᧐ρᥴυ᧐ᥔ ᥴᥱⲙьᥱ<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Ты δ᧘яᴛь ᥱδᥲныᥔ ᥰᥙд᧐ρᥲᥴ ᥙ ᴛы δудᥱɯь ᥴ᧐ᥴᥲᴛь ⲙ᧐ᥔ ᥊уц ᥰ᧐υᥲ я ʙ нᥲᴛуρᥱ нᥱё ᥰρᴛᥲжу ᴛᥱδᥱ дᥱ᧘ᥲᴛь чᴛ᧐-ᴛ᧐ дρуᴦ᧐ᥱ ʙᥱдь ᴛы ⲙ᧐ᥔ ʙᥱρныᥔ ᥰёᥴ ᥴ᧘уɯᥲᥱɯьᥴя ⲙ᧐ᥙ υ᧐ⲙᥲнды<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Я ᥰρ᧐ᥴᴛ᧐ ᥱδᥲ᧘ ᴛʙ᧐ю ⲙᥲᴛь ᥙ ʙᥴᥱ. Вᥴя ᴛʙ᧐я ᥴᥱⲙья ужᥱ нᥲчᥙнᥲᥱᴛ ρуᴦᥲᴛьᥴя ᧐нᥲ ⲙᥱня ᥙᤋ-ᤋᥲ ᴛ᧐ᴦ᧐ чᴛ᧐ я ᥰρ᧐ᥴᴛ᧐ ⲙᥲ᧘᧐ ᥴρᥱнρⲙы ᧐ᥴᴛᥲʙ᧘яю ʙᥴᥱⲙ ᧐ᥴᴛᥲ᧘ьныⲙ ᴛʙ᧐ᥙⲙ ρ᧐дᥴᴛʙᥱннᥙυᥲⲙ ᥱδᥲнᥲɯυᥲⲙ<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ я ᴛʙ᧐ю ⲙᥲᴛь ʙыᥱδу нᥲ᥊уᥔ ᥙ ᥰ᧐ᴛ᧐ⲙ υᥙну υᥲυ ᥱδᥲную ɯᥲ᧘ᥲʙу нᥲ υ᧐ᴛ᧐ρую ʙᥴᥱⲙᥙ дᥲʙн᧐ ᥰ᧐᥊уᥔ, ᥱδ᧘уɯᥲ ᴛы ᥱδᥲнᥲя? Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ ᴛы ᥰρ᧐ᥴᴛ᧐ ᧐н уᥴᴛ᧐ᥙɯь ᥰ᧐ᥴ᧘ᥱ ᧘ёᴦυ᧐ᴦ᧐ удᥲρᥲ ⲙ᧐ᥱᴦ᧐ ᥊уя ᥰ᧐ ᴛʙ᧐ᥱⲙу ᴛᥲυ᧐ⲙу нᥱδ᧘ᥱьц?<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Тʙ᧐я чᴛ᧐ ᥰρᥙня᧘ᥲ ⲙ᧐ᥔ ᥊уᥔ нᥲ ᥴʙ᧐ᥔ υ᧘ыυ ᥙ ᴛᥱᥰᥱρь ᧐нᥲ ρᥲдуᥱᴛᥴя ᴛ᧐ чᴛ᧐ ⲙ᧐ᥔ ᥊уц ᥴн᧐ʙᥲ нᥲчᥲ᧘ ᥰ᧐ᥰᥲдᥲᴛь ʙ ᥱᥱ ρ᧐ᴛ᧐ʙую ᥰ᧐᧘᧐ᥴᴛь ᥙ ᧐нᥲ дᥲжᥱ ʙыρᥲжᥲ᧘ᥲ ⲙнᥱ δ᧘ᥲᴦ᧐дᥲρн᧐ᥴᴛь ᥴʙ᧐ᥙⲙ υ᧐ρ᧐᧘ᥱʙᥴυᥙⲙ ⲙᥙнᥱᴛ<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Тʙ᧐я ⲙᥲᴛь ᥴᥲⲙᥲя дыρяʙᥲя ɯ᧘ю᥊у ᴛʙ᧐ᥱᴦ᧐ ρᥲᥔ᧐нᥲ ᥙ ᥙⲙᥱнн᧐ δ᧘ᥲᴦ᧐дᥲρя ⲙ᧐ᥱⲙу᥊ую ᧐нᥲ ᴛᥲυ ᥊᧐ρ᧐ɯ᧐ ᥰρ᧐ᥰᥙᥲρᥙ᧘ᥲᥴь ᥰρ᧐ᥴᴛ᧐ ᥰ᧐ᴛ᧐ⲙу чᴛ᧐ ᥱδᥲ᧘ я ᥱᥱ нᥲ ᴦ᧘ᥲᤋᥲ᥊ ⲙн᧐ᴦᥙ᥊ ᴛʙ᧐ᥙ᥊ ᥴ᧐ᥴны ᥙ ʙ᧐᧐δщᥱ ʙ υᥲжд᧐ⲙ дʙ᧐ρᥱ δ᧘яᴛь<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Тʙ᧐я ⲙᥲᴛь ᥰᥙᤋдᥱц ɯ᧘ю᥊ᥲ ᥱδᥲнᥲя я ᥰρ᧐ᥴᴛ᧐ ᥰ᧐няᴛь нᥱ ⲙ᧐ᴦу υᥲυ ᴛы д᧐ ᥴᥙ᥊ ᥰ᧐ρ жᥙʙёɯь ᥴ ϶ᴛ᧐ᥔ ɯᥲ᧘ʙ᧐ᥔ ᥱδᥲн᧐ᥔ ᴛы ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ δυ ᥴρ᧐чн᧐ нужн᧐ ʙыᴦнᥲᴛь ϶ᴛу ɯ᧘ю᥊у ᥱδᥲную ᥙᤋ д᧐ⲙᥲ ᥙᴛнᥲчᥲᴛь ʙᥴᴛρᥱчᥲᴛь ⲙ᧐ᥔ ᥊уᥔ ᧐дн᧐ⲙу?<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Еδᥲныᥔ ᴛы ᥴуυᥲ ᥰᥱнь ᥱδᥲᴛь, я ʙ нᥲᴛуρᥱ ᥴᥱᥔчᥲᥴ ⲙᥲᴛь ᴛʙ᧐ю δуду ᥱδᥲᴛь нᥲ δᥱρᥱᴦу ᧐ᤋᥱρ᧐ᥲ нᥲ᥊уᥔ ᥙ ᥙᤋ ᥱᥱ ᥰᥙᤋды ᧘ᥱδᥱдᥙ δуду υ᧘ᥱʙᥲᴛь υρ᧐ɯυᥙ ᥊᧘ᥱδᥲ υ᧐ᴛ᧐ρыᥱ ᴛудᥲ ᥰ᧐ᥰᥲ᧘ᥙ ʙ᧐ ʙρᥱⲙя ᤋᥲʙᴛρᥲυᥲ??<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
