' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Ты υ᧐ρ᧐чᥱ д᧐ ᥴᥙ᥊ ᥰ᧐ρ ʙᥙдᥲᴛь нᥙ᥊уя нᥱ ᥰ᧐ня᧘ чᴛ᧐ я ᥰᥙᤋду ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ᥙᥴᥰ᧐᧘ьᤋую υᥲυ ᥙᴦρуɯυу д᧘я ᥴᥱυᥴуᥲ᧘ьны᥊ уᴛᥱ᥊, ᥱδᥲныᥔ ᴛы дундуυ ᥴуυᥲ?? ᴛы δ᧘яᴛь ᥙдᥙ ʙ ᥊уᥔ нᥲρядᥙᥴь υ᧘᧐ун ᥱδᥲныᥔ ᥙ д᧐ᥰᥙʙᥲᥔ ᥴʙ᧐ᥔ чᥲᥔ ʙ υ᧐ᴛ᧐ρыᥔ я υ᧐нчᥲ᧘<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
