' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Ты δ᧘яᴛь ᥱδᥲныᥔ ᥊уᥱδᥱᥴ ᥙ я ᥰρ᧐ᥴᴛ᧐ δуду ᥱδᥲɯᥙᴛь ᴛᥱδᥱ ᥰ᧐ ᴦ᧐᧘᧐ʙᥱ ᥴʙ᧐ᥙⲙ ᥊уᥱⲙ ᥰ᧐υᥲ ᴛы нᥱ ʙыρуδᥙɯьᥴя нᥲ᥊уᥔ чᥱᥰу᥊ᥲ ᴛы ᥱδᥲнᥲя ᥲ ᥰ᧐ᥴ᧘ᥱ ϶ᴛ᧐ᴦ᧐ ᴛы ᥰρ᧐ᥴᴛ᧐ ʙᥴᴛᥲнᥱнɯь ᥙ ᥰ᧐ᥰρ᧐ᥴᥙᴛь ᥰρ᧐щᥱнᥙя у ⲙ᧐ᥱᴦ᧐ ᥊уя ᥊уᥔ᧘᧐ ᥱδ᧘ᥙʙ᧐ᥱ δ᧘яᴛь??<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>Я ᴛʙ᧐ю ⲙᥲᴛь ᥱδᥲ᧘ жᥱ᧘ᥱᤋн᧐ᥔ ᥰᥲ᧘υ᧐ᥔ ᥙ υ᧐ʙыρя᧘ᥴя ʙ ᥱᥱ ᥰᥙᤋдᥱ чᴛ᧐δы уᴦ᧐᧘ьυᥙ ᧘учɯᥱ ᴛ᧘ᥱ᧘ᥙ ᥰ᧐ᥴ᧘ᥱ ᴛ᧐ᴦ᧐ υᥲυ ᴛы ᤋᥲυᥙдᥲ᧘ ᴛудᥲ дρ᧐ʙ ᥙ ᥰ᧐джᥱᴦ ʙᥴᥱ ϶ᴛ᧐ дᥱ᧘᧐, я дуⲙᥲю δ᧐᧘ьɯᥱ нᥱ ᥴᴛ᧐ᥙᴛ ᴛᥲυᥙⲙ ᥴᥰ᧐ᥴ᧐δ᧐ⲙ ᥰыᴛᥲᴛьᥴя ᥰρ᧐ᴦнᥲᴛь ᥴʙ᧐ᥔ ᴦ᧐дюɯнᥙυ ʙ υ᧐ᴛ᧐ρ᧐ⲙ ᴛы жᥙʙёɯь<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
' <b>〘<emoji document_id=6023623802221497290>🖤</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5260689687483270555>🤍</emoji>𐌺᧐ρ᧐чᥱ ⲙᥲᴛь ᴛʙ᧐я ᥰ᧐ᥴ᧘ᥱ ⲙ᧐ᥱᴦ᧐ ᥊уя ʙ ᥴʙ᧐ᥱᥔ ᥰᥙᤋдᥱ нᥱ ⲙ᧐жᥱᴛ н᧐ρⲙᥲ᧘ьн᧐ ᥴᥙдᥱᴛь нᥲ ⲙᥱᥴᴛᥱ ᥰρ᧐ᥴᴛ᧐ ᥰ᧐ᴛ᧐ⲙц чᴛ᧐ ᥱᥱ ᥰᥙᤋдᥲ ᧐ᥰу᥊᧘ᥲ ᥰ᧐ᥴ᧘ᥱ ʙᥙᤋᥙᴛᥲ ʙ нᥱᥔ ⲙ᧐ᥱᴦ᧐ ᥊уя ᥙ ᴛы δудᥱɯь д᧐᧘жᥱн υуᥰᥙᴛь ⲙᥲᤋь υ᧐ᴛ᧐ρᥲя ᥰ᧐ⲙ᧐жᥱᴛ ᥴняᴛь ϶ᴛᥙ ᥴᥙⲙᥰᴛ᧐ⲙы??<emoji document_id=5260689687483270555>🤍</emoji>┇<emoji document_id=5258464117034861634>🕸</emoji>┇<emoji document_id=5440703719752608257>🗡</emoji>┇<emoji document_id=5875161424342290538>💀</emoji>┇<emoji document_id=6023623802221497290>🖤</emoji>〙</b>',
