    async def kinfo(self, _: InlineQuery) -> dict:
        """➤ ⭐𐌿꤀ӄⲁⳅы𐌱ⲁꤕⲧ ⲧ𐌱꤀ύ ᥰⲣ꤀ჶυ᠕ь💜"""

