    async def kobfcmd(self, message):
        """➤ ⭐Шυჶⲣყꤕⲧ ჶⲁύ᠕ с υсᥰ꤀᠕ьӡ꤀𐌱ⲁнυꤕⲙ 𐌱ꤌ᥉ꤕ64💜"""


